import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

function MyApp()
{
  return(
  <div>
  <h2>Hi</h2>
  <p>How are you</p>
  <ul>
    <li>1</li>
    <li>2</li>
    <li>3</li>
  </ul>
  </div>
   )
}
ReactDOM.render(<MyApp/>
  ,
  document.getElementById("root")
);
